-- 进入 SQL*Plus 时，当前是 SYSDBA
whenever sqlerror exit failure rollback;

-- 1) 重置演示用户（每次启动都回到相同状态）
BEGIN
EXECUTE IMMEDIATE 'DROP USER ORACLE_DEMO CASCADE';
EXCEPTION WHEN OTHERS THEN
  IF SQLCODE != -01918 AND SQLCODE != -01940 THEN -- ORA-01918: user 'DEMO' does not exist; ORA-01940: cannot drop a user that is currently connected
    RAISE;
END IF;
END;
/

CREATE USER ORACLE_DEMO IDENTIFIED BY "Demo!1234Ab"
  DEFAULT TABLESPACE USERS
  TEMPORARY TABLESPACE TEMP
  QUOTA UNLIMITED ON USERS;

GRANT CREATE SESSION, CREATE TABLE, CREATE VIEW, CREATE SEQUENCE, CREATE PROCEDURE TO ORACLE_DEMO;

-- 2) 切换到演示用户
ALTER SESSION SET CURRENT_SCHEMA=ORACLE_DEMO;

------------------------------------------------------------
-- 0) 清理旧对象
------------------------------------------------------------
BEGIN
FOR t IN (SELECT table_name FROM user_tables WHERE table_name IN (
    'WQ_SECTION','WQ_INDICATOR_DICT','WQ_METHOD_DICT','WQ_QUALITY_CODE','WQ_SAMPLE','WQ_RESULT'
  )) LOOP
    EXECUTE IMMEDIATE 'DROP TABLE '||t.table_name||' PURGE';
END LOOP;
END;
/
BEGIN
FOR s IN (SELECT sequence_name FROM user_sequences WHERE sequence_name IN (
    'WQ_SECTION_SEQ','WQ_SAMPLE_SEQ','WQ_RESULT_SEQ'
  )) LOOP
    EXECUTE IMMEDIATE 'DROP SEQUENCE '||s.sequence_name;
END LOOP;
END;
/

------------------------------------------------------------
-- 1) 断面表
------------------------------------------------------------
CREATE TABLE WQ_SECTION (
                            SECTION_ID        NUMBER(19)      PRIMARY KEY,
                            SECTION_CODE      VARCHAR2(64),
                            SECTION_NAME      VARCHAR2(200),
                            RIVER_NAME        VARCHAR2(128),
                            BASIN_CODE        VARCHAR2(64),
                            WATER_TYPE        VARCHAR2(32),
                            LONGITUDE         NUMBER(10,6),
                            LATITUDE          NUMBER(10,6),
                            ELEVATION_M       NUMBER(8,2),
                            ADMIN_REGION_CODE VARCHAR2(12),
                            STATUS            NUMBER(1),
                            EXT_JSON          CLOB,
                            CREATED_AT        TIMESTAMP(6),
                            UPDATED_AT        TIMESTAMP(6)
);

CREATE SEQUENCE WQ_SECTION_SEQ START WITH 1 INCREMENT BY 1 NOCACHE NOCYCLE;

------------------------------------------------------------
-- 2) 指标字典
------------------------------------------------------------
CREATE TABLE WQ_INDICATOR_DICT (
                                   INDICATOR_CODE   VARCHAR2(64)   PRIMARY KEY,
                                   INDICATOR_NAME   VARCHAR2(200),
                                   UNIT             VARCHAR2(32),
                                   LOWER_DETECT_LIM NUMBER(14,6),
                                   UPPER_LIMIT_REF  NUMBER(14,6),
                                   CATEGORY         VARCHAR2(64),
                                   REMARK           VARCHAR2(4000),
                                   CREATED_AT       TIMESTAMP(6)
);

------------------------------------------------------------
-- 3) 方法字典
------------------------------------------------------------
CREATE TABLE WQ_METHOD_DICT (
                                METHOD_CODE   VARCHAR2(64) PRIMARY KEY,
                                METHOD_NAME   VARCHAR2(200),
                                SOURCE_STD    VARCHAR2(128),
                                REMARK        VARCHAR2(4000),
                                CREATED_AT    TIMESTAMP(6)
);

------------------------------------------------------------
-- 4) 质量代码字典
------------------------------------------------------------
CREATE TABLE WQ_QUALITY_CODE (
                                 QUALITY_CODE  VARCHAR2(16) PRIMARY KEY,
                                 QUALITY_DESC  VARCHAR2(200),
                                 SEVERITY      NUMBER(1),
                                 CREATED_AT    TIMESTAMP(6)
);

------------------------------------------------------------
-- 5) 采样事件表（不分区）
------------------------------------------------------------
CREATE TABLE WQ_SAMPLE (
                           SAMPLE_ID      NUMBER(19)    PRIMARY KEY,
                           SECTION_CODE   VARCHAR2(64),
                           SAMPLE_TIME    TIMESTAMP(3),
                           SAMPLE_DATE    DATE,
                           WATER_DEPTH_M  NUMBER(8,3),
                           WEATHER        VARCHAR2(64),
                           SAMPLER        VARCHAR2(128),
                           DEVICE_CODE    VARCHAR2(128),
                           SOURCE         VARCHAR2(64),
                           BATCH_ID       VARCHAR2(64),
                           REMARK         VARCHAR2(4000),
                           CREATED_AT     TIMESTAMP(6)
);

CREATE SEQUENCE WQ_SAMPLE_SEQ START WITH 1 INCREMENT BY 1 NOCACHE NOCYCLE;

------------------------------------------------------------
-- 6) 监测结果表（不分区）
------------------------------------------------------------
CREATE TABLE WQ_RESULT (
                           RESULT_ID      NUMBER(19)    PRIMARY KEY,
                           SECTION_CODE   VARCHAR2(64),
                           INDICATOR_CODE VARCHAR2(64),
                           SAMPLE_TIME    TIMESTAMP(3),
                           SAMPLE_DATE    DATE,
                           VALUE_NUM      NUMBER(20,8),
                           UNIT           VARCHAR2(32),
                           METHOD_CODE    VARCHAR2(64),
                           DETECT_LIMIT   NUMBER(20,8),
                           QUALIFIER      VARCHAR2(8),
                           QUALITY_CODE   VARCHAR2(16),
                           SOURCE         VARCHAR2(64),
                           BATCH_ID       VARCHAR2(64),
                           EXT_JSON       CLOB,
                           CREATED_AT     TIMESTAMP(6),
                           CONSTRAINT UK_WQ_RESULT UNIQUE (SECTION_CODE, SAMPLE_TIME, INDICATOR_CODE)
);

CREATE SEQUENCE WQ_RESULT_SEQ START WITH 1 INCREMENT BY 1 NOCACHE NOCYCLE;

------------------------------------------------------------
-- 7) 表注释
------------------------------------------------------------
COMMENT ON TABLE WQ_SECTION        IS '水质监测断面表（监测点基础信息）';
COMMENT ON TABLE WQ_INDICATOR_DICT IS '监测指标字典表（COD、NH3N、TP 等标准指标信息）';
COMMENT ON TABLE WQ_METHOD_DICT    IS '监测/实验方法字典表（采样和检测的标准方法）';
COMMENT ON TABLE WQ_QUALITY_CODE   IS '质量代码字典表（数据质量标记：OK/缺测/可疑等）';
COMMENT ON TABLE WQ_SAMPLE         IS '采样事件表（现场采样或在线采样事件记录）';
COMMENT ON TABLE WQ_RESULT         IS '监测结果表（采样数据与分析结果记录）';

------------------------------------------------------------
-- 8) 字段注释
------------------------------------------------------------
/* WQ_SECTION */
COMMENT ON COLUMN WQ_SECTION.SECTION_ID         IS '断面主键（数值型，由序列分配）';
COMMENT ON COLUMN WQ_SECTION.SECTION_CODE       IS '断面编码（第三方/平台唯一编码，用于软关联）';
COMMENT ON COLUMN WQ_SECTION.SECTION_NAME       IS '断面名称';
COMMENT ON COLUMN WQ_SECTION.RIVER_NAME         IS '河流/水体名称（如河流、湖库等）';
COMMENT ON COLUMN WQ_SECTION.BASIN_CODE         IS '流域编码（行业或本地编码体系）';
COMMENT ON COLUMN WQ_SECTION.WATER_TYPE         IS '水体类型（地表水/地下水/饮用水源等）';
COMMENT ON COLUMN WQ_SECTION.LONGITUDE          IS '经度（WGS84，度，6位小数）';
COMMENT ON COLUMN WQ_SECTION.LATITUDE           IS '纬度（WGS84，度，6位小数）';
COMMENT ON COLUMN WQ_SECTION.ELEVATION_M        IS '高程（米）';
COMMENT ON COLUMN WQ_SECTION.ADMIN_REGION_CODE  IS '行政区划码（国家标准编码）';
COMMENT ON COLUMN WQ_SECTION.STATUS             IS '状态：1启用/0停用';
COMMENT ON COLUMN WQ_SECTION.EXT_JSON           IS '扩展信息（JSON 文本，如断面属性、对接原始元数据）';
COMMENT ON COLUMN WQ_SECTION.CREATED_AT         IS '创建时间';
COMMENT ON COLUMN WQ_SECTION.UPDATED_AT         IS '最近更新时间';

/* WQ_INDICATOR_DICT */
COMMENT ON COLUMN WQ_INDICATOR_DICT.INDICATOR_CODE    IS '指标代码（如：CODMn、NH3N、TP、DO 等）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.INDICATOR_NAME    IS '指标名称（中文全称）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.UNIT              IS '计量单位（mg/L、µg/L、NTU、℃ 等）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.LOWER_DETECT_LIM  IS '方法检出限（最小可检出浓度）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.UPPER_LIMIT_REF   IS '参考上限/管控阈值（可选）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.CATEGORY          IS '指标类别（理化/营养盐/金属/有机物/毒理等）';
COMMENT ON COLUMN WQ_INDICATOR_DICT.REMARK            IS '备注说明';
COMMENT ON COLUMN WQ_INDICATOR_DICT.CREATED_AT        IS '创建时间';

/* WQ_METHOD_DICT */
COMMENT ON COLUMN WQ_METHOD_DICT.METHOD_CODE    IS '监测/实验方法代码（如：HJ/T 399-2007 等）';
COMMENT ON COLUMN WQ_METHOD_DICT.METHOD_NAME    IS '方法名称（中文全称）';
COMMENT ON COLUMN WQ_METHOD_DICT.SOURCE_STD     IS '标准来源/出版机构（可选）';
COMMENT ON COLUMN WQ_METHOD_DICT.REMARK         IS '备注说明';
COMMENT ON COLUMN WQ_METHOD_DICT.CREATED_AT     IS '创建时间';

/* WQ_QUALITY_CODE */
COMMENT ON COLUMN WQ_QUALITY_CODE.QUALITY_CODE  IS '质量码（OK/EST/MISS/SUS/ERR 等）';
COMMENT ON COLUMN WQ_QUALITY_CODE.QUALITY_DESC  IS '质量码说明（如 正常/估算/缺测/可疑/错误）';
COMMENT ON COLUMN WQ_QUALITY_CODE.SEVERITY      IS '严重级别：0正常，1提示，2可疑，3错误';
COMMENT ON COLUMN WQ_QUALITY_CODE.CREATED_AT    IS '创建时间';

/* WQ_SAMPLE */
COMMENT ON COLUMN WQ_SAMPLE.SAMPLE_ID       IS '采样事件主键（数值型，由序列分配）';
COMMENT ON COLUMN WQ_SAMPLE.SECTION_CODE    IS '断面编码（软关联 WQ_SECTION.SECTION_CODE）';
COMMENT ON COLUMN WQ_SAMPLE.SAMPLE_TIME     IS '采样时间（或在线数据统计时刻）';
COMMENT ON COLUMN WQ_SAMPLE.SAMPLE_DATE     IS '采样日期（通常取 SAMPLE_TIME 的日期，用于汇总）';
COMMENT ON COLUMN WQ_SAMPLE.WATER_DEPTH_M   IS '取样深度（米）';
COMMENT ON COLUMN WQ_SAMPLE.WEATHER         IS '采样时天气（晴/阴/雨等）';
COMMENT ON COLUMN WQ_SAMPLE.SAMPLER         IS '采样人/采样单位';
COMMENT ON COLUMN WQ_SAMPLE.DEVICE_CODE     IS '设备/采样瓶/车载站编号（可选）';
COMMENT ON COLUMN WQ_SAMPLE.SOURCE          IS '数据来源（在线/实验室/平台名称）';
COMMENT ON COLUMN WQ_SAMPLE.BATCH_ID        IS '批次号（用于同批任务追踪）';
COMMENT ON COLUMN WQ_SAMPLE.REMARK          IS '备注说明';
COMMENT ON COLUMN WQ_SAMPLE.CREATED_AT      IS '创建时间';

/* WQ_RESULT */
COMMENT ON COLUMN WQ_RESULT.RESULT_ID        IS '监测结果主键（数值型，由序列分配）';
COMMENT ON COLUMN WQ_RESULT.SECTION_CODE     IS '断面编码（软关联 WQ_SECTION.SECTION_CODE）';
COMMENT ON COLUMN WQ_RESULT.INDICATOR_CODE   IS '指标代码（软关联 WQ_INDICATOR_DICT.INDICATOR_CODE）';
COMMENT ON COLUMN WQ_RESULT.SAMPLE_TIME      IS '采样/在线时间（对应某次采样事件或在线时点）';
COMMENT ON COLUMN WQ_RESULT.SAMPLE_DATE      IS '采样日期（通常取 SAMPLE_TIME 的日期）';
COMMENT ON COLUMN WQ_RESULT.VALUE_NUM        IS '实测数值（与 UNIT 搭配使用）';
COMMENT ON COLUMN WQ_RESULT.UNIT             IS '计量单位（与字典中的单位保持一致或按实际记录冗余）';
COMMENT ON COLUMN WQ_RESULT.METHOD_CODE      IS '监测/实验方法代码（软关联 WQ_METHOD_DICT.METHOD_CODE）';
COMMENT ON COLUMN WQ_RESULT.DETECT_LIMIT     IS '检出限（如 <DL 时可配合 QUALIFIER 表达）';
COMMENT ON COLUMN WQ_RESULT.QUALIFIER        IS '结果修饰符：<、>、ND、≈ 等';
COMMENT ON COLUMN WQ_RESULT.QUALITY_CODE     IS '质量码（OK/EST/MISS/SUS/ERR 等，不设外键）';
COMMENT ON COLUMN WQ_RESULT.SOURCE           IS '数据来源（在线/实验室/平台名称）';
COMMENT ON COLUMN WQ_RESULT.BATCH_ID         IS '批次号（同批导入/同次任务标记）';
COMMENT ON COLUMN WQ_RESULT.EXT_JSON         IS '扩展信息（JSON 文本，如修正说明、原始回执）';
COMMENT ON COLUMN WQ_RESULT.CREATED_AT       IS '创建时间';

